import React from 'react';
import { connect } from 'react-redux';
import axios from 'axios';
//import PropTypes from "prop-types";

const Table = () => {
	const invoiceTable = () => {
		axios.get('/api/invoice/all').then(res => {
			res.data.map(item => {
				return <div key={item.invoice_id}>{item.order_id}</div>;
			});
		});
	};

	return (
		<div>
			<p>Table</p>
			{invoiceTable()}
		</div>
	);
};
Table.prototype = {};

// const mapStateToProps = state => ({
//   auth: state.auth
// });

export default connect()(Table);
